import React from 'react';

import './WorkExperience.css';
import { Container, Row, Col } from 'react-bootstrap';

import Dot from './dot.svg';

export default props => {
    return(
        <a name="experience">
            <div className="work-experience">
                <Container>
                    <Row>
                        <Col xs={12} sm={12} md={12} lg={12}>
                            <p className="work-title">Work Experience</p>
                        </Col>
                        <div className="divider"></div>
                    {/* </Row> */}
                    {/* <Row> */}
                        <Col xs={4} sm={4} md={8} lg={8}>
                            <center>
                            <img src={Dot} height="7px" width="7px" className="dot" />
                            <div className="vertical-div"></div>
                            </center>
                        </Col>
                        <Col xs={4} sm={4} md={8} lg={8}>
                            <div className="description">
                                <p id="desc-title"><b>UNLV Network Development and Engineering</b></p><br/>
                                Student Network Technician<br/>
                                Job Duties:<br/>
                            </div>
                        </Col>
                    </Row>
                </Container>
            </div>
        </a>
    );
}
